import styled from "styled-components";
import { Link } from "react-router-dom";
import classes from './style.module.css';

const DivForUser = styled.div`
    width: 290px;
    height: 300px;
    margin: 12px;
    display: inline-block;
    background: #FFFFFF;
`;
const ImgFromUser = styled.img`
    /* width: 100px;
    height: 100px;
    border-radius: 50%; */
`;
const H1FromName = styled.h2`
    /* color: red; */
`;
const H1FromUserName = styled.h2`
    /* color: red; */
`;
const ButtonFromPath = styled.button`
    /* border-radius: 5px; */
`;

const User = (props) => {
    const { user, path } = props;
    return ( 
        <DivForUser className={classes.user}>
            <ImgFromUser className={classes.userImg} src={user.img} />
            <H1FromName className={classes.name}>{user.name}</H1FromName>
            <H1FromUserName className={classes.username}>{user.username}</H1FromUserName>
            <Link to={path}>
                <ButtonFromPath className={classes.button}>see user</ButtonFromPath>
            </Link>
        </DivForUser>
    );
};

export { User };
